import { Link } from "react-router-dom/cjs/react-router-dom.min";

const Products = () => {
  return (
    <section>
      <ul>
        <li><Link></Link>Books</li>
        <li><Link></Link>Games</li>
        <li><Link></Link>An Online Course</li>
      </ul>
    </section>
  );
  // <h1>All product available</h1>;
};
  
export default Products;
